<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <meta name="robots" content="noindex, nofollow" />
  <title>Faisal Mohammed - Resume Landing Page</title>
  <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0/dist/css/bootstrap.min.css" rel="stylesheet" />
  <link href="https://cdn.jsdelivr.net/npm/bootstrap-icons@1.10.5/font/bootstrap-icons.css" rel="stylesheet" />
  <link href="https://fonts.googleapis.com/css2?family=Noto+Kufi+Arabic&family=Noto+Sans:wght@400;600;700&display=swap" rel="stylesheet" />
  <link rel="icon" href="https://cdn.jsdelivr.net/npm/bootstrap-icons@1.10.5/icons/file-earmark.svg" type="image/svg+xml" />
  <style>
    html, body {
      height: 100vh; /* Full viewport height */
      margin: 0;
      padding: 0;
      direction: ltr;
      background-color: #1C2526; /* Dark gray background for dark mode */
      color: #E0E0E0; /* Light gray text for readability */
      font-family: 'Noto Sans', sans-serif;
      display: flex;
      flex-direction: column;
    }
    body {
      min-height: 100vh; /* Ensure body takes full viewport height */
    }
    header {
      background: linear-gradient(135deg, #26A69A 0%, #2E3B3E 100%); /* Teal to dark gradient */
      color: #FFFFFF;
      padding: 15px 0; /* Moderate padding */
      box-shadow: 0 4px 8px rgba(0, 0, 0, 0.3);
    }
    header .container-fluid {
      display: flex;
      flex-direction: column;
      justify-content: center; /* Center content horizontally */
      align-items: center; /* Center content vertically */
      text-align: center; /* Center text */
    }
    header h1 {
      font-size: 2.2em; /* Adjusted for better fit */
      margin: 0;
      font-weight: 700;
    }
    header p {
      font-size: 1.2em;
      margin: 8px 0;
      font-weight: 400;
    }
    header a {
      margin: 8px 0; /* Ensure copy link button is centered */
    }
    .card-custom {
      background-color: #2E3B3E; /* Slightly lighter dark shade for cards */
      border: none;
      border-radius: 15px;
      box-shadow: 0 6px 12px rgba(0, 0, 0, 0.2);
      margin-bottom: 1.5rem; /* Moderate margin */
      padding: 1.75rem; /* Slightly reduced for less internal spacing */
      transition: transform 0.3s ease;
    }
    .card-custom:hover {
      transform: translateY(-5px);
    }
    .btn-action {
      width: 500px; /* Fixed width for consistency in both languages */
      margin: 0.4rem auto; /* Center buttons */
      display: block;
      background-color: #26A69A; /* Teal buttons */
      border: none;
      padding: 10px;
      font-size: 1em; /* Adjusted for text fit */
      font-weight: 600;
      border-radius: 10px;
      transition: background-color 0.3s ease, transform 0.2s ease;
    }
    .btn-action:hover {
      background-color: #FF7043; /* Deep orange on hover */
      transform: scale(1.05);
    }
    .btn-warning {
      background-color: #FF7043; /* Deep orange for download button */
    }
    .btn-warning:hover {
      background-color: #D65D38;
    }
    .btn-outline-primary {
      border-color: #26A69A;
      color: #FFFFFF; /* White text for readability */
    }
    .btn-outline-primary:hover {
      background-color: #FF7043;
      color: #FFFFFF;
      border-color: #FF7043;
    }
    .copy-link {
      background-color: #6c757d;
      color: #FFFFFF;
      padding: 8px 15px;
      border-radius: 8px;
      font-size: 0.9em;
      text-decoration: none;
      display: inline-block;
      transition: background-color 0.3s ease, transform 0.2s ease;
    }
    .copy-link:hover {
      background-color: #FF7043;
      transform: scale(1.05);
    }
    .grid-section {
      display: flex;
      flex-wrap: wrap;
      gap: 1rem;
      justify-content: center;
      margin-top: 1rem;
    }
    .grid-section .card {
      flex: 1 1 calc(25% - 1rem);
      min-width: 150px;
      background-color: #2E3B3E;
      border: none;
      border-radius: 10px;
      padding: 0.75rem 1rem;
      color: #FFFFFF;
      font-weight: 500;
      transition: transform 0.3s ease, box-shadow 0.3s ease;
      text-align: center;
    }
    .grid-section .card:hover {
      transform: translateY(-5px);
      box-shadow: 0 8px 16px rgba(0, 0, 0, 0.3);
      background-color: #26A69A;
    }
    .modal-content {
      background-color: #1C2526;
      color: #E0E0E0;
      border-radius: 15px;
      border: none;
      box-shadow: 0 8px 16px rgba(0, 0, 0, 0.3);
    }
    .modal-header {
      background-color: #2E3B3E;
      border-bottom: 1px solid #26A69A;
    }
    .modal-body {
      max-height: 80vh; /* Allow scrolling in modal for long content */
      overflow-y: auto;
      padding: 1.5rem;
    }
    .modal-body table {
      background-color: #2E3B3E;
      color: #E0E0E0;
    }
    .modal-body th {
      background-color: #26A69A;
      color: #FFFFFF;
      font-weight: 600;
    }
    .modal-body td {
      background-color: #2E3B3E;
      color: #E0E0E0;
    }
    .section-heading {
      border-bottom: 2px solid #26A69A;
      display: inline-block;
      padding-bottom: 0.25rem;
      margin-top: 1.2rem;
      color: #FFFFFF;
      font-weight: 600;
    }
    main {
      flex: 1;
      display: flex;
      align-items: center; /* Center content vertically */
      justify-content: center; /* Center content horizontally */
      padding: 15px 0; /* Moderate padding */
    }
    footer {
      background: linear-gradient(135deg, #2E3B3E 0%, #1C2526 100%);
      color: #E0E0E0;
      padding: 12px 0; /* Moderate padding */
      font-size: 0.9em;
    }
    footer .container-fluid {
      display: flex;
      justify-content: center; /* Center footer content */
      text-align: center; /* Center text */
    }
    .btn-close {
      filter: invert(1);
    }
    [dir="rtl"] {
      font-family: 'Noto Kufi Arabic', sans-serif;
    }
    [dir="rtl"] header .container-fluid,
    [dir="rtl"] footer .container-fluid {
      text-align: center; /* Ensure centering in RTL */
    }
    @media (max-height: 600px) {
      .card-custom {
        padding: 1rem;
        margin-bottom: 1rem;
      }
      .btn-action {
        padding: 8px;
        font-size: 0.9em; /* Adjusted for smaller screens */
      }
      header {
        padding: 10px 0;
      }
      footer {
        padding: 8px 0;
      }
    }
    @media (max-width: 576px) {
      .btn-action {
        width: 100%; /* Full width on small screens */
        max-width: 400px; /* Prevent buttons from being too wide on small screens */
      }
    }
  </style>
</head>

  </main>

        </div>
        <div class="modal-body" id="modalBody"></div>
      </div>
    </div>
  </div>
  <footer>
    <div class="container-fluid">
      <span id="footerText">© Faisal Mohammed. All rights reserved.</span>
    </div>
